import styled from 'styled-components'

export const StyledButton = styled.button`
background: #fff;
color: #b71540;
font-size: 1.5rem;
outline: 0 none;
border: 2px solid #b71540;
border-radius: 10px;
cursor: pointer;
width: 300px;
height: 50px;
max-width: 300px;
max-height: 50px; 
&:hover {
    color: white;
    background: #b71540;
    border: transparent;
}
`

export const StyledNavButton = styled.button`
background: #fff;
color: #0652DD;
outline: 0 none;
border: 2px solid #0652DD;
border-radius: 10px;
cursor: pointer;
width: 250px;
height: 40px;
max-width: 250px;
max-height: 40px; 
&:hover {
    color: white;
    background: #0652DD;
    border: transparent;
}
`
